"use strict";(self.webpackChunkup_docs=self.webpackChunkup_docs||[]).push([[717],{4168:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"welcome","metadata":{"permalink":"/docs/blog/welcome","editUrl":"https://github.com/uptoolkit/docs/tree/main/blog/blog/2021-08-26-welcome/index.md","source":"@site/blog/2021-08-26-welcome/index.md","title":"Welcome","description":"Docusaurus blogging features are powered by the blog plugin.","date":"2021-08-26T00:00:00.000Z","formattedDate":"August 26, 2021","tags":[{"label":"solid","permalink":"/docs/blog/tags/solid"},{"label":"opinionated","permalink":"/docs/blog/tags/opinionated"}],"readingTime":0.405,"hasTruncateMarker":false,"authors":[{"name":"Daniel Sum","title":"Creator of Up Toolkit","url":"https://github.com/danielsum","imageURL":"https://github.com/danielsum.png","key":"dansum"}],"frontMatter":{"slug":"welcome","title":"Welcome","authors":["dansum"],"tags":["solid","opinionated"]}},"content":"[Docusaurus blogging features](https://docusaurus.io/docs/blog) are powered by the [blog plugin](https://docusaurus.io/docs/api/plugins/@docusaurus/plugin-content-blog).\\n\\nSimply add Markdown files (or folders) to the `blog` directory.\\n\\nRegular blog authors can be added to `authors.yml`.\\n\\nThe blog post date can be extracted from filenames, such as:\\n\\n- `2019-05-30-welcome.md`\\n- `2019-05-30-welcome/index.md`\\n\\nA blog post folder can be convenient to co-locate blog post images:\\n\\n![Docusaurus Plushie](./docusaurus-plushie-banner.jpeg)\\n\\nThe blog supports tags as well!\\n\\n**And if you don\'t want a blog**: just delete this directory, and use `blog: false` in your Docusaurus config."}]}')}}]);